import React from 'react';
import { Link } from 'react-scroll';
import Home from './components/Home';
import Projects from './components/Projects';
import Skills from './components/Skills';
import LetsConnect from './components/LetsConnect';

function App() {
  return (
    <div className="font-sans">
      {/* Navbar */}
      <header className="fixed top-0 left-0 right-0 bg-gray-900 text-white shadow z-50">
        <div className="max-w-7xl mx-auto px-6 py-4 flex justify-between items-center">
          <h1 className="text-xl font-bold">Ayush Yadav</h1>
          <nav className="space-x-6 text-sm sm:text-base">
            <Link to="home" smooth={true} duration={500} className="cursor-pointer hover:text-pink-500">Home</Link>
            <Link to="projects" smooth={true} duration={500} className="cursor-pointer hover:text-pink-500">Projects</Link>
            <Link to="skills" smooth={true} duration={500} className="cursor-pointer hover:text-pink-500">Skills</Link>
            <Link to="letsconnect" smooth={true} duration={500} className="cursor-pointer hover:text-pink-500">Connect</Link>
          </nav>
        </div>
      </header>

      {/* Page Sections */}
      <main className="pt-20 scroll-smooth">
        <section id="home"><Home /></section>
        <Projects />
        <Skills />
        <LetsConnect />
      </main>

      {/* Footer */}
      <footer className="bg-gray-900 text-center text-white py-6">
        Â© 2025 Ayush Yadav. All rights reserved.
      </footer>
    </div>
  );
}

export default App;
